import React from 'react'
import Axios from 'axios'

function getApi(){
    try {
        const res = Axios.get("/test").then(response => response.data);
        console.log(res.rows)
    } catch (err){
        console.log(err)
    }
}
function Databases(){
    return(
        <div>
            <h1>Databases</h1>
            <p>{getApi()}</p>
        </div>
    )
}

export default Databases;
